pragma solidity >= 0.4.4 < 0.7.0;
pragma experimental ABIEncoderV2;

contract mas_variables{

    // Variables string
    string mi_primer_string;
    string saludo = "hola como estas";
    string cadena_vacia = "";
    string nombre = "Luciano";

    // Variables booleanas
    bool mi_primer_booleano;
    bool flag_true = true;
    bool flag_false = false;

    // Variables de tipo Byte
    bytes32 mi_primer_bytes;
    bytes4 segundo_bytes;
    bytes32 hash = keccak256(abi.encodePacked(nombre));
    bytes4 identificador;

    function ejemploBytes4() public{
        identificador = msg.sig;
    }
    
}
